/**
 * Provides previews for selecting/moving/resizing shapes when creating/removing space.
 *
 */
export default class SpaceToolPreview {
    static $inject: string[];
    /**
     * @param eventBus
     * @param elementRegistry
     * @param canvas
     * @param styles
     */
    constructor(
      eventBus: EventBus,
      elementRegistry: ElementRegistry,
      canvas: Canvas,
      styles: Styles
    );
}

type Canvas = import('diagram-js/lib/core/Canvas').default;
type ElementRegistry = import('diagram-js/lib/core/ElementRegistry').default;
type EventBus = import('diagram-js/lib/core/EventBus').default;
type Styles = import('diagram-js/lib/draw/Styles').default;
